Description:	This Powershell library file contains resources for IISLogsAnalyser.ps1
                script.
                It contains:
                -   WelcomeSplash_Img (Base64 string of embedded image for main
                    script's splash screen)
                -   LogFieldList (Array of LogField objects to list available
                    W3C log Fields and select them)
#>

#-------------------------------------------------------------------------------
#region: LogFieldList array of all possible W3C fields from a IIS log file.
[LogField[]]$LogFieldList = @()
$LogFieldList += [LogField]::New("date", "Date", "The date on which the activity occurred.", $true, "")
$LogFieldList += [LogField]::New("time", "Time", "The time, in coordinated universal time (UTC), at which the activity occurred.", $false, "")
$LogFieldList += [LogField]::New("s-sitename", "Service Name and Instance Number", "The Internet service name and instance number that was running on the client.", $false, "")
$LogFieldList += [LogField]::New("s-computername", "Server Name", "The name of the server on which the log file entry was generated.", $false, "")
$LogFieldList += [LogField]::New("s-ip", "Server IP Address", "The IP address of the server on which the log file entry was generated.", $false, "")
$LogFieldList += [LogField]::New("cs-method", "Method", "The requested verb, for example, a GET method.", $false, "")
$LogFieldList += [LogField]::New("cs-uri-stem", "URI Stem", "The target of the verb, for example, Default.htm.", $true, "")
$LogFieldList += [LogField]::New("cs-uri-query", "URI Query", "The query, if any, that the client was trying to perform. A Universal Resource Identifier (URI) query is necessary only for dynamic pages.", $false, "")
$LogFieldList += [LogField]::New("s-port", "Server Port", "The server port number that is configured for the service.", $false, "")
$LogFieldList += [LogField]::New("cs-username", "User Name", "The name of the authenticated user that accessed the server. Anonymous users are indicated by a hyphen.", $true, "c-ip")
$LogFieldList += [LogField]::New("c-ip", "Client IP Address", "The IP address of the client that made the request.", $true, "cs-username")
$LogFieldList += [LogField]::New("cs-version", "Protocol Version", "The HTTP protocol version that the client used.", $false, "")
$LogFieldList += [LogField]::New("cs(User-Agent)", "User Agent", "The browser type that the client used.", $false, "")
$LogFieldList += [LogField]::New("cs(Cookie)", "Cookie", "The content of the cookie sent or received, if any.", $false, "")
$LogFieldList += [LogField]::New("cs(Referrer)", "Referrer", "The site that the user last visited. This site provided a link to the current site.", $false, "")
$LogFieldList += [LogField]::New("cs-host", "Host", "The host header name, if any.", $false, "")
$LogFieldList += [LogField]::New("sc-status", "HTTP Status", "The HTTP status code.", $false, "")
$LogFieldList += [LogField]::New("sc-substatus", "Protocol Substatus", "The substatus error code.", $false, "")
$LogFieldList += [LogField]::New("sc-win32-status", "Win32 Status", "The Windows status code.", $false, "")
$LogFieldList += [LogField]::New("sc-bytes", "Bytes Sent", "The number of bytes sent by the server.", $false, "")
$LogFieldList += [LogField]::New("cs-bytes", "Bytes Received", "The number of bytes received and processed by the server.", $false, "")
$LogFieldList += [LogField]::New("time-taken", "Time Taken", "The length of time that the action took, in milliseconds.", $false, "")
#endregion
